import React, { Component } from 'react'
import ClassTest from './ClassTest'

class ClassProps extends Component {
  render() {
    return (
      <div>
        <ClassTest employeename="Andrei Agbisit"
        employeeposition="President" company="ABC Company"/>

        <ClassTest employeename="Paul Dano"
        employeeposition="President" company="ABC Company"/>

        <ClassTest employeename="Lods Idle G. Bautista"
        employeeposition="President" company="ABC Company"/>        
      </div>
    )
  }
}

export default ClassProps
